import {cardData} from "./data/cat_data";
import Card from "./Components/Card";

function Cats(){
    const catCards = cardData.map(item =>{
        return (
            <Card title={item.title} />
        );
    });
    return (
        <div className="cat_main__content">
            Cats
        </div>
    )
}
export default Cats;
